/**
* This function provides an interface to the College Adaptor to 
* retrieve the internal SIS unique Identifier for the student identified by the CCCID
* 
* @param &bindVars array of keys to retrieve from the staging table
* &bindVars[1]: external system code (perhaps 'CID')
* &bindVars[2]: external Id (perhaps sis CCC Id California Community Colleges ID)
* @Returns 2d array with Emplid in first row/first column, if any
*/
method getEmplIdFromExternalId
   /+ &bindVars as Array of Any +/
   /+ Returns Array2 of Any +/

   rem validate parameters/arguments;
   If &bindVars.Len <> 2 Then
      Error "bindVars should have 2 elements when getting the emplid by externalId";
   End-If;

   If None(&bindVars [1]) Then
      Error "external_system_code is required";
   End-If;
   If None(&bindVars [2]) Then
      Error "external_Id is required";
   End-If;

   Local string &emplid = "";
   Local array of any &AAny = CreateArrayAny();
   Local SQL &sql = GetSQL(SQL.CCTC_EXTID_EMPLID_GET, &bindVars);
   If &sql.Status <> %SQLStatus_OK Then
      Error String(&sql.Status);
   Else
      Local number &i = 0;
      Local number &maxRows = 1;
      While &sql.Fetch(&AAny) And
            &i < &maxRows
         &emplid = &AAny [1];
         &i = &i + 1;
      End-While;
   End-If;
   &sql.Close();

   Return CreateArray(CreateArrayAny(&emplid));

end-method;

