/**
* This function provides an interface to the College Adaptor to 
* associate the CCCId (california community collleges ID) for the student
* identified by the internal SIS unique Identifier (emplid)
* 
* @param &bindVars array of keys to retrieve from the staging table
* &bindVars[1]: external system code (perhaps 'CID')
* &bindVars[2]: emplid (aka sisPersonId)
* &bindVars[3]: external system id (aka cccid)
* @Returns 2d array with the number of rows affected in first row/first column
*/
method setExternalIdForEmplId
   /+ &bindVars as Array of Any +/
   /+ Returns Array2 of Any +/

   rem validate parameters/arguments;
   If &bindVars.Len <> 3 Then
      Error "bindVars should have 3 elements when geting the external_id";
   End-If;

   If None(&bindVars [1]) Then
      Error "external_system_code is required";
   End-If;

   If None(&bindVars [2]) Then
      Error "emplid is required";
   End-If;

   If None(&bindVars [3]) Then
      Error "cccId is required";
   End-If;

   rem Check to see if this record already exists;
   Local array of any &existsParams = CreateArrayAny();
   &existsParams [1] = &bindVars [1];
   &existsParams [2] = &bindVars [2];
   Local array of array of any &exists = %This.getExternalIdFromEmplId(&existsParams);
   If &exists [1][1] = &bindVars [3] Then
      Error "External Id already set on given emplid";
   End-If;

   &existsParams = CreateArrayAny();
   &existsParams [1] = &bindVars [1];
   &existsParams [2] = &bindVars [3];
   &exists = %This.getEmplIdFromExternalId(&existsParams);
   If Not (None(&exists [1][1])) Then
      Error "External Id already in use";
   End-If;

   rem since not going against staging table, always use a built-in/standard CI;
   Local ApiObject &oExtSysCI = (%Session).GetCompIntfc(CompIntfc.CCTC_EXT_SYS_ID);
   If &oExtSysCI = Null Then
      Error "Could not instantiate the CCTC_EXT_SYS_ID Component Interface";
   End-If;

   &oExtSysCI.InteractiveMode = False;
   &oExtSysCI.GetHistoryItems = True;
   &oExtSysCI.EditHistoryItems = False;

   &oExtSysCI.EMPLID = &bindVars [2];
   If Not (&oExtSysCI.Get()) Then
      Error "Could not get the ext sys record for the given emplid";
   End-If;

   rem find the sysKeyDetail match (by EXTERNAL_SYSTEM);
   Local ApiObject &sysKeyDetailCollection = &oExtSysCI.EXTERNAL_SYSKEY;
   Local ApiObject &sysKeyDetail = Null;
   Local number &i = 0;
   For &i = 1 To &sysKeyDetailCollection.Count
      Local ApiObject &curSysKeyItem = &sysKeyDetailCollection.Item(&i);
      If &curSysKeyItem.EXTERNAL_SYSTEM = &bindVars [1] Then
         &sysKeyDetail = &curSysKeyItem;
         &i = &sysKeyDetailCollection.Count + 1;
         Break;
      End-If;
   End-For;

   Local number &sysKeyCreated = 0;
   rem if sysKeyDetail match (by EXTERNAL_SYSTEM) not found, create the header item;
   If &sysKeyDetail = Null Then
      &sysKeyDetail = &sysKeyDetailCollection.InsertItem(&sysKeyDetailCollection.Count);
      If &sysKeyDetail = Null Then
         Error "Could not insert a record stub into sysKeyDetailCollection";
      End-If;
      &sysKeyDetail.EXTERNAL_SYSTEM = &bindVars [1];
      If Not (&oExtSysCI.Save()) Then
         Error "Could not save when attempting to add new header record";
      End-If;
      If Not &oExtSysCI.Cancel() Then
         Error "Canceling (to exit out gracefully) failed afer adding new header record";
      End-If;
      Error "Successfully saved new header record, but not attempting child record as to not bring down server; re-submit request";
   End-If;


   Local ApiObject &extSysDetailCollection = &sysKeyDetail.EXTERNAL_SYSTEM_1;
   rem at this point, we know that the new external id does not yet exists (based on exists check above);
   rem also know that the header row does exist (cause if it didn't, we just created it);
   rem so now, just need to add the new external id to the extSysDetailCollection;
   If &extSysDetailCollection = Null Then
      Error "Could not load the ext sys Detail Collection";
   End-If;

   Local ApiObject &extSysDetail = &extSysDetailCollection.InsertItem(&extSysDetailCollection.Count);
   &extSysDetail.EFFDT = %AsOfDate;
   &extSysDetail.EXTERNAL_SYSTEM_ID = &bindVars [3];

   If Not &oExtSysCI.Save() Then
      Error "Saving the ext sys ci (to add new external_system_id) failed";
   End-If;

   If Not &oExtSysCI.Cancel() Then
      Error "Canceling (to exit out gracefully) failed";
   End-If;

   Return CreateArray(CreateArrayAny(1));

end-method;

