/**
* This function provides an interface to the College Adaptor to 
* retrieve basic identity/login data per person in a given list
* 
* @param &bindVars[1]: list of comma separated sisPersonIds e.g. "10, 23, 45"
* @Returns 2d array with a row/array per person in list
*/
method getPeople
   /+ &bindVars as Array of Any +/
   /+ Returns Array2 of Any +/

   rem validate parameters/arguments;
   If &bindVars.Len <> 1 Then
      Error "bindVars should have 1 element when getting people data";
   End-If;

   If None(&bindVars [1]) Then
      Error "a list of emplids is required";
   End-If;

   Local array of any &AAny = CreateArrayAny();
   Local array of array &result_list = CreateArrayRept(&AAny, 0);

   Local SQL &sql = GetSQL(SQL.CCTC_PEOPLE_NAMES_GET, &bindVars);
   If &sql.Status <> %SQLStatus_OK Then
      Error String(&sql.Status);
   Else
      Local number &i = 0;
      Local number &maxRows = 999;
      While &sql.Fetch(&AAny) And
            &i < &maxRows
         Local number &j = 0;
         Local array of any &temp = CreateArrayAny();
         For &j = 1 To &AAny.Len
            &temp.Push(&AAny [&j]);
         End-For;
         &result_list.Push(&temp);
         &i = &i + 1;
      End-While;
   End-If;
   &sql.Close();

   Return &result_list;

end-method;

